import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
@Injectable({
  providedIn: 'root',
})
export class QuestionServiceService {
  constructor(private http: HttpClient) {}

  getQuestions() {
    return this.http.get<any>('db/questions.json');
  }
}
